import axios from "axios";
const API_URL = "http://localhost:3080/";

export const getProducts = async () => {
  try {
    const response = await axios.get(API_URL);
    console.log(res);
    return response;
  } catch (err) {
    console.error(err);
    throw err;
  }
};
